import React from "react";
import axios from "axios";
import { useEffect, useState } from "react";
import Card from "@material-ui/core/Card";
import CardContent from "@material-ui/core/CardContent";
import Typography from "@material-ui/core/Typography";
import CardMedia from "@material-ui/core/CardMedia";
import { makeStyles } from "@material-ui/core/styles";

function TrafficCard({ img, location }) {
	const useStyles = makeStyles({
		root: {
			marginRight: 20,
			marginLeft: 20,
		},
		media: {
			height: 200,
			width: 200,
		},
	});

	const classes = useStyles();
	// const [trafficLocation, setTrafficLocation] = useState("");

	const token = process.env.REACT_APP_API_KEY_SLA_TOKEN;
	const camLocationUrl = `https://developers.onemap.sg/privateapi/commonsvc/revgeocode?location=${location.latitude},${location.longitude}&token=${token}`;

	useEffect(() => {
		axios.get(camLocationUrl).then((res) => {
			// setTrafficLocation(res.data.GeocodeInfo[0].ROAD);
			console.log(res.data);
		});
	}, [img]);
	console.log(img);
	return (
		<Card className={classes.root}>
			<CardContent>
				<Typography gutterBottom variant="h6">
					{/* {trafficLocation} */}
				</Typography>
				<CardMedia className={classes.media} image={img} />
			</CardContent>
		</Card>
	);
}

export default TrafficCard;
